          spriteWidth: 64,
          spriteHeight: 64
        },
        {
          xOffset: 320,
          yOffset: 64,
          spriteWidth: 64,
          spriteHeight: 64
        },
        {
          xOffset: 384,
          yOffset: 64,
          spriteWidth: 64,
          spriteHeight: 64
        },
        {
          xOffset: 448,
          yOffset: 64,
          spriteWidth: 64,
          spriteHeight: 64
        },
        {
          xOffset: 0,
          yOffset: 128,
          spriteWidth: 64,
          spriteHeight: 64
        },
        {
